svg.script:
document.documentElement.onload = function() {
	document.getElementById('ms-logomark-line').onmouseover = changeHoverColor;
	document.getElementById('ms-logomark-mask').onmouseover = changeHoverColor;
	document.getElementById('ms-logomark-stroke').onmouseover = changeHoverColor;
	document.getElementById('ms-logomark-line').onmouseout = changeDefaultColor;
	document.getElementById('ms-logomark-mask').onmouseout = changeDefaultColor;
	document.getElementById('ms-logomark-stroke').onmouseout = changeDefaultColor;
}
function changeHoverColor() {
	document.getElementById('ms-logomark-line').setAttribute('fill', '#FFFFFF');
	document.getElementById('ms-logomark-mask').setAttribute('fill', '#0CB9C7');
	document.getElementById('ms-logomark-stroke').setAttribute('stroke', '#0CB9C7');
}
function changeDefaultColor() {
	document.getElementById('ms-logomark-line').setAttribute('fill', '#0CB9C7');
	document.getElementById('ms-logomark-mask').setAttribute('fill', '#FFFFFF');
	document.getElementById('ms-logomark-stroke').setAttribute('stroke', '#7D7D7D');
}
